import React from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { get_products } from '../features/restaurantsFeatures';
function RestaurantsListScreen() {

    const [restaurants, setRestaurants] = React.useState([])

    const restaurantsList = useSelector(state => state.restaurants)
    const dispatch = useDispatch()

    React.useEffect(() => {
        dispatch(get_products())
        console.log(restaurantsList?.then(data => console.log(data)))

    })

    console.log(restaurantsList)
    return (
        <div

        >
            <h1>Restaurants list</h1>
        </div>
    )
}

export default RestaurantsListScreen
